import React from 'react';
import { Switch, Route, Redirect } from 'react-router-dom'
import SignIn from './containers/SignIn'

const App = () => {
  return (
    <Switch>
      <Route exact path='/' component={SignIn}/>
    </Switch>
  );
}

export default App;
